import React from "react";
import { Connect } from "react-redux";
class About extends React.Component {
  render() {
    return (
      <>
        <p>This is About</p>
      </>
    );
  }
}
const mappingRedux = (state) => {
  const reduxData = state;
  return reduxData;
};
export default Connect(mappingRedux)(About);
